    <style>
        .gallery .row {
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between; /* Adjusts spacing between images */
        }
        .gallery figure {
            flex: 0 0 10%; /* Each figure takes up 10% of the row */
            margin: 0; /* Remove default margin */
            padding: 5px; /* Optional: Add some padding around each figure */
        }
        .thumbnail-img {
            display: grid; /* Use grid layout */
            grid-template-columns: repeat(6, 1fr); /* 6 videos per row */
            gap: 1rem; /* Space between the thumbnails */
            margin-top: 2rem; /* Space above the thumbnails *
        }
        .thumbnail-img img {
            display: block; /* Ensure the anchor behaves like a block element */
            text-align: center; /* Center the caption text */
            width: 200px; /* Set a fixed width for the thumbnails */
        }
         /* Ensure each image takes up 10% of the row */
        .col-lg-2 {
             width: 100%; /* Make the image responsive */
            height: auto; /* Maintain aspect ratio */
        }

        .col-lg-12{
             width: 100%; /* Make the image responsive */
            height: auto; /* Maintain aspect ratio */
        }
        .col-lg-4 { width: 100%; /* Make the image responsive */
            height: auto; /* Maintain aspect ratio */
